  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'discord-getting-started',
	title: 'Getting Started',
	sidebar_label: 'Getting Started'
};
export const metadata = {
  "id": "discord-getting-started",
  "title": "Getting Started",
  "description": "You can join the Discord here, If you have been assigned a “Raid Guild Member” role, then you will be able to access all of Raid Guild’s internal channels.",
  "source": "@site/docs/discord-getting-started.md",
  "permalink": "/savedao/docs/discord-getting-started",
  "editUrl": "https://github.com/raid-guild/handbook/edit/master/docs/discord-getting-started.md",
  "sidebar_label": "Getting Started",
  "sidebar": "howSidebar",
  "previous": {
    "title": "Etiquette",
